const Experience = () => {
  const experiences = [
    {
      title: 'Senior Full Stack Developer',
      company: 'Tech Solutions Inc.',
      year: '2022 - Present',
      description: 'Leading development team, architecting scalable web applications, and mentoring junior developers.'
    },
    {
      title: 'Frontend Developer',
      company: 'Digital Agency',
      year: '2020 - 2022',
      description: 'Developed responsive web applications using React and modern frontend technologies.'
    },
    {
      title: 'Junior Developer',
      company: 'Nozom Co.',
      year: '2024 - 2025',
      description: 'Built web applications and gained experience in full-stack development By .'
    }
  ];

  return (
    <section id="experience" className="section-padding" role="region" aria-labelledby="experience-title">
      <div className="container">
        <h2 id="experience-title" className="section-title h1">Experience</h2>
        <div className="timeline">
          {experiences.map((exp, index) => (
            <article className="timeline-item" key={index} data-aos="fade-left" data-aos-delay={index * 200}>
              <h3 className="h4 text-primary">{exp.title}</h3>
              <h4 className="h6 text-muted mb-2">{exp.company}</h4>
              <time className="badge bg-primary mb-2">{exp.year}</time>
              <p>{exp.description}</p>
            </article>
          ))}
        </div>
      </div>
    </section>
  );
};
export default Experience;
